  false,\n\t\"url\": null,\n\t\"notes\": \"Raw DNA chromatogram data produced by the
  ABI 373, 377, 3130 and 3730 automated sequencing machines in ABI format.  These
  are from fish (primarily Sebastes spp., Seriola lalandi, and several shark species)
  and invertebrates (primarily Haliotis spp.).  These data are in either of 2 formats,
  \".fsa\" files containing chromatograms used for genotyping, and \".ab1\" files
  containing chromatograms of DNA sequences.  These data are used for studies on taxonomy,
  population connectivity, species identification, and studies of mating systems\",\n\t\"license_title\":
